    <script>
        // Wait for the DOM to be fully loaded before running the map script
        document.addEventListener('DOMContentLoaded', function () {
            try {
                console.log("Map script starting...");

                // --- 1. INITIALIZE THE MAP ---
                const map = L.map('map').setView([60.45, 22.26], 10); // Default view

                // --- 2. DEFINE BASEMAPS ---
                const osmLayer = L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
                    maxZoom: 19,
                    attribution: '&copy; <a href="http://www.openstreetmap.org/copyright">OpenStreetMap</a>',
                    opacity: 0.4
                });

                const imageUrl = 'background_map.png';
                const imageBounds = [[60.41101203705511, 24.834031507476247], [60.42199256610327, 24.855982237592055]];
                const localMapLayer = L.imageOverlay(imageUrl, imageBounds);

                const baseMaps = {
                    "Oma Kartta": localMapLayer,
                    "OpenStreetMap": osmLayer
                };

                // Add the OSM layer first so it's under the local map
                osmLayer.addTo(map);
                localMapLayer.addTo(map);
                console.log("Base map layers added.");

                // --- 3. LOAD GEOMETRY DATA FROM THE DOM ---
                const tontitDataEl = document.getElementById('tontit-data');
                const tontitGeoJson = JSON.parse(tontitDataEl.textContent);
                console.log("Tontit GeoJSON data loaded.");

                const contoursDataEl = document.getElementById('contours-data');
                const contoursGeoJson = JSON.parse(contoursDataEl.textContent);
                console.log("Contours GeoJSON data loaded.");

                // --- 4. PROCESS AND DISPLAY LAYERS ---
                const tontitLayer = L.geoJSON(tontitGeoJson, {
                    style: { color: '#e2a03b', weight: 2, fillOpacity: 0.2 },
                    onEachFeature: function (feature, layer) {
                        if (feature.properties && feature.properties.Nimi) {
                            layer.bindPopup(`<b>${feature.properties.Nimi}</b>`);
                        }
                    }
                });

                const contoursLayer = L.geoJSON(contoursGeoJson, {
                    style: { color: '#87CEFA', weight: 1 },
                    onEachFeature: function (feature, layer) {
                        if (feature.geometry && feature.geometry.coordinates && feature.geometry.coordinates[0] && feature.geometry.coordinates[0].length > 2) {
                            layer.bindPopup(`Korkeus: ${feature.geometry.coordinates[0][2]} m`);
                        }
                    }
                });

                const userLocationGroup = L.featureGroup().addTo(map);

                const tontitFeatureGroup = L.featureGroup([tontitLayer]).addTo(map);
                contoursLayer.addTo(map);
                console.log("Vector layers created and added to map.");

                // --- 5. ADD LAYER CONTROL ---
                const overlayMaps = {
                    "Tontit": tontitFeatureGroup,
                    "Korkeuskäyrät": contoursLayer,
                    "Oma Sijainti": userLocationGroup
                };
                L.control.layers(baseMaps, overlayMaps).addTo(map);
                console.log("Layer control added.");

                // --- 6. SET MAP VIEW ---
                const bounds = tontitFeatureGroup.getBounds();
                if (bounds.isValid()) {
                    map.fitBounds(bounds);
                    console.log("Map view zoomed to tontit bounds.");
                } else {
                    console.error("Tontit bounds are not valid. Map view remains at default.");
                }

                // --- 7. GEOLOCATION ---
                function onLocationFound(e) {
                    const radius = e.accuracy;
                    userLocationGroup.clearLayers();
                    L.marker(e.latlng).addTo(userLocationGroup)
                        .bindPopup("Olet " + radius.toFixed(0) + " metrin säteellä tästä pisteestä.").openPopup();
                    L.circle(e.latlng, radius).addTo(userLocationGroup);
                    console.log("Geolocation successful.");
                }

                function onLocationError(e) {
                    console.error("Geolocation error:", e.message);
                    alert("Sijainnin haku epäonnistui: " + e.message);
                }

                map.on('locationfound', onLocationFound);
                map.on('locationerror', onLocationError);

                map.locate({setView: false, maxZoom: 16});
                console.log("Geolocation requested.");

                console.log("Map script finished successfully.");

            } catch (e) {
                console.error("A critical error occurred in the map script:", e);
            }
        });
    </script>
